import React from 'react'
import { Link } from 'react-router-dom'
const Navbar = () => {
  return (
<nav className='navbar'>
  <h1>
    <a Link=''>
      <i className='navbar-brand'>e-shop</i> 
    </a>
  </h1>
  <ul>
    <li><a Link="">Merchants</a></li>
    <li><a Link="">Register</a></li>
    <li><a Link="">Login</a></li>
  </ul>
</nav>
  );
};

export default Navbar
